import React from 'react';
import {StyleSheet} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Login from './screens/login';
import ListProperties from './screens/list-properties';
import CreateProperties from './screens/create-properties';
import UpdateProperties from './screens/update-appointment';
import CancelProperties from './screens/cancel-appointment';
import CreateUsers from './screens/create-users';
import color from './styles/colors';

const Stack = createStackNavigator();

function App() {

  return (
    <NavigationContainer>
      <Stack.Navigator>
        {/* <Stack.Screen name="Login" component={Login} options={{ title: 'Login' }} /> */}
        {/* <Stack.Screen name="ListProperties" component={ListProperties} options={{ title: 'Properties' }} /> */}
        <Stack.Screen screenOptions={{headerShown: style={color:'#272727'}}}   name="CreateProperties" component={CreateProperties} options={{ title: 'AIR BnB' }} />
        <Stack.Screen style={styles.head} name="UpdateProperties" component={UpdateProperties} options={{ title: 'Update Property' }} />
        <Stack.Screen style={styles.head} name="CancelProperties" component={CancelProperties} options={{ title: 'Cancel Property' }} />
        <Stack.Screen style={styles.head} name="CreateUsers" component={CreateUsers} options={{ title: 'Users Registration' }} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  head: {
      backgroundColor: color.Gray,
  },
});

export default App;
